import * as Types from './../Constants/ActionTypes.jsx';

const initialState = null;

export const myPages = (state = initialState, action) => {
  switch (action.type) {
    case Types.SAVE_MY_PAGE:
      state = action.mypages
      return state
      break;
    default: return state
  }
}
